import React from "react";
import PageHeading from "../../components/PageHeading";
import "./Skills.css";

const Skills = () => {
  return (
    <>
      {/* Main Skills Page */}
      <main className="skills-container">
        {/* Display the page header */}
        <PageHeading title="Skills" description="Deep-dive into" />
        <div className="skills">
          {/* Display the list of skills */}
          <div className="frontend-skills-card">
            <p>Technical</p>
            <button className="btn">HTML</button>
            <button className="btn">CSS</button>
            <button className="btn">JavaScript</button>
            <button className="btn">React.JS</button>
          </div>
          <div className="frontend-skills-card">
            <p>Back-end Skills</p>
            <button className="btn">Node.JS</button>
            <button className="btn">PostgresSQL</button>
            <button className="btn">Firebase</button>
            <button className="btn">Git</button>
          </div>
        </div>
      </main>
    </>
  );
};

export default Skills;
